There is another property called details: For Category::Neko, Category::Husbando, Category::Kitsune, Category::Waifu (Image endpoints): #[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let details = nekosbest::get(nekosbest::Category::Neko) .await? .details .try_into_image() .unwrap(); println!("Source: {}", details.source_url); println!("Artist: {}", details.artist_name); println!("Artist link: {}", details.artist_href); Ok(())
} For everything else (GIF endpoints): #[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let details = nekosbest::get(nekosbest::Category::Pat) .await? .details .try_into_gif() .unwrap(); println!("Anime name: {}", details.anime_name); Ok(())
} Or with the strong-types feature, bringing strong types guarantees for details, so no unwrap / expect for the details type: Warning : Experimental, may change at any point in the future. Remember to add the st_ in front of get, get_amount, get_with_client and get_with_client_amount. Neko: #[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let resp = nekosbest::st_get::<nekosbest::Neko>().await?; let details = resp.details(); println!("Artist: {}", details.artist_name); println!("Artist link: {}", details.artist_href); println!("Source: {}", details.source_url); Ok(())
} GIF: #[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let details = nekosbest::st_get::<nekosbest::Pat>().await?.details; println!("Anime name: {}", details.anime_name); Ok(())
} By using the local feature, you can completely skip requests to the API. #[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> { let img_url = nekosbest::local::Neko.get(); // requires the "local" feature println!("{}", img_url); Ok(())
} Or if you have your own random number: fn main() { let your_random = unimplemented!(); let img_url = nekosbest::local::Neko.get_random(your_random); println!("{}", img_url); Ok(())
} Take a look at the build script and src/local.rs if you want to find out how it works.
